Hello and thank you for applying for ‘Stephen Avenue Live!’. We appreciate the time and talent that you have put into the application. At this time, we will not be proceeding with your application.
 
The City of Calgary has other locations throughout the city for street performers.  You can find more information on their website;
https://www.calgary.ca/csps/recreation/pages/arts-and-culture/busking.aspx

